:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  WILLIAMS, Herbert William and MASON, Bertha Louisa Gertrude
  "WELL AS A iian leonina and sai 1 m. Sarah. 01> WILLIAMS, Zoe
  b 30.10.1889 d 18.02.1962
  Zoe b. and d. at Gisborne. Because of her mother's ill health, Zoe took over the management
  of her parents' household, particularly at Bishop's Court, Napier, in the period from 1929
  to 1937. She was housekeeper for her brother Quentin at "Mangatai" station (1937-45) and
  then lived in Gisborne. She was an accomplished needlewoman and a much respected aunt to the
  younger members of the family.
  02> WILLIAMS, Ursula
  b 15.05.1891 d 19.06.1960
  Ursula b, at Gisborne, d. at Porirua and bd, at Wellington. Ursula was educated at Diocesan
  School for Girls, Auckland, and was a VAD at Trentham Military Hospital after WW1. She
  worked as an aide at maternity hospitals in Hawkes Bay and lived at "Mangatai" station from
  1937 to 1945. In her later years she lived in Gisborne and followed her interest in
  gardening. For many years she was a member of the Poverty Bay Gardening Circle.
  03> WILLIAMS, Vera m on 27.04.1926 to SEWELL, Taare Warneford (Rua)
  b 19.05.1893 d 28.07.1984
  b 27.04.1901 d 21.09.1956
  Vera b. and d. at Gisborne. Vera and Taare both bd. at Taruheru Cemetery,
  Gisborne.
  Vera was educated at Diocesan School for Girls, Auckland, where she developed her
  artistic talents, particularly in sketching and water-colour painting. She was a
  VAD at Trentham Military Hospital after WW1. In her later years she was a keen
  | walker, and won prizes at the Poverty Bay A&P Show for her tapestry.
  Rua was educated at Palmerston North Boys' High School. He worked as shepherd on "Ruangarehu" station,
  "Puketoro" station and "Mangatai" station. In 1928 he purchased the 50 acre property, "Whaiti" at Patutahi
  where he became a dairy farmer and pig breeder. He was a member of the Pig Industry Council, chairman of
  the Patutahi School Committee, a member of the Cook County Council and on the Board of Governors of the
  Gisborne High School.
  01> SEWELL, Marie Vera m on 02.02.1952 to BARKER, George Temple
  b 10.01.1927 d 19.04.1980
  b 22.07.1924
  Marie b. at Gisborne. Address: 150 Landing Road, Kerikeri.
  Marie was educated at Gisborne High School and was a school dental nurse. George was educated at
  Christ's College, Christchurch, and was a sheep farmer in Canterbury, Otago and Taranaki.
